INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 401, 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2020/07/31 12:00:00", 24001, 0.0, 10046, "2030/12/17 14:59:59", "アヤネ", 102301, 2, 0.0, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 402, 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2020/07/31 12:00:00", 24002, 0.0, 10046, "2030/12/17 14:59:59", "アヤネ", 102301, 2, 2.21, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 403, 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2020/07/31 12:00:00", 24003, 0.0, 10046, "2030/12/17 14:59:59", "アヤネ", 102301, 2, 0.0, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 701, 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2020/07/31 12:00:00", 24004, 0.0, 10046, "2030/12/17 14:59:59", "アサヒ", 192201, 1, 1.99, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 702, 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2020/07/31 12:00:00", 24005, 0.0, 10046, "2030/12/17 14:59:59", "アサヒ", 192201, 2, 2.21, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 703, 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2020/07/31 12:00:00", 24006, 0.0, 10046, "2030/12/17 14:59:59", "アサヒ", 192201, 1, 3.33, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 801, 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2020/07/31 12:00:00", 24007, 0.0, 10046, "2030/12/17 14:59:59", "部員３", 192301, 2, 0.0, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 802, 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2020/07/31 12:00:00", 24008, 0.0, 10046, "2030/12/17 14:59:59", "部員３", 192301, 2, 2.68, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 803, 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2020/07/31 12:00:00", 24009, 0.0, 10046, "2030/12/17 14:59:59", "部員３", 192301, 2, 0.0, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 501, 24, "やった！", "2020/07/31 12:00:00", 24010, 0.0, 10046, "2030/12/17 14:59:59", "", 192501, 1, 0.0, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 502, 24, "勝ったよ！", "2020/07/31 12:00:00", 24011, 0.0, 10046, "2030/12/17 14:59:59", "", 192501, 1, 0.0, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 503, 24, "いい調子！", "2020/07/31 12:00:00", 24012, 0.0, 10046, "2030/12/17 14:59:59", "", 192501, 1, 0.0, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 111, 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2020/07/31 12:00:00", 24013, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 5.33, 6);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 112, 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2020/07/31 12:00:00", 24014, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 6.85, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 113, 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2020/07/31 12:00:00", 24015, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 3.0, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 611, 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2020/07/31 12:00:00", 24016, 0.0, 10046, "2030/12/17 14:59:59", "ダイチ", 192401, 2, 6.11, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 612, 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2020/07/31 12:00:00", 24017, 0.0, 10046, "2030/12/17 14:59:59", "ダイチ", 192401, 2, 6.75, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 613, 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2020/07/31 12:00:00", 24018, 0.0, 10046, "2030/12/17 14:59:59", "ダイチ", 192401, 2, 0.0, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 211, 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2020/07/31 12:00:00", 24019, 0.0, 10046, "2030/12/17 14:59:59", "ハツネ", 113401, 1, 4.52, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 212, 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2020/07/31 12:00:00", 24020, 0.0, 10046, "2030/12/17 14:59:59", "ハツネ", 113401, 1, 3.89, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 213, 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2020/07/31 12:00:00", 24021, 0.0, 10046, "2030/12/17 14:59:59", "ハツネ", 113401, 2, 13.49, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 311, 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2020/07/31 12:00:00", 24022, 0.0, 10046, "2030/12/17 14:59:59", "カヤ", 106501, 2, 3.17, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 312, 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2020/07/31 12:00:00", 24023, 0.0, 10046, "2030/12/17 14:59:59", "カヤ", 106501, 2, 4.42, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 313, 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2020/07/31 12:00:00", 24024, 0.0, 10046, "2030/12/17 14:59:59", "カヤ", 106501, 1, 2.89, 6);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 421, 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2020/07/31 12:00:00", 24025, 0.0, 10046, "2030/12/17 14:59:59", "アヤネ", 102301, 3, 3.71, 4);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 721, 24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2020/07/31 12:00:00", 24026, 0.0, 10046, "2030/12/17 14:59:59", "アサヒ", 192201, 1, 5.1, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 821, 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2020/07/31 12:00:00", 24027, 0.0, 10046, "2030/12/17 14:59:59", "部員３", 192301, 3, 4.34, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (0.0, 521, 24, "いい勝負だったよ\nまたやろうね", "2020/07/31 12:00:00", 24028, 0.0, 10046, "2030/12/17 14:59:59", "", 192501, 1, 0.0, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (-360.0, 101, 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2020/07/31 12:00:00", 24029, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 5.62, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (-360.0, 102, 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2020/07/31 12:00:00", 24030, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 9.58, 1);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (-360.0, 103, 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2020/07/31 12:00:00", 24031, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 0.0, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (-360.0, 104, 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2020/07/31 12:00:00", 24032, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 1, 9.13, 2);
INSERT INTO `v1_41e0966e655ea5b31ee03936fafa86625da445be4d0982b6530e77edf7b7c5ef` VALUES (-360.0, 105, 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2020/07/31 12:00:00", 24033, 0.0, 10046, "2030/12/17 14:59:59", "ミサト", 113501, 2, 8.27, 1);
